(103, '<div style=\"font-weight:bold;\">\r\n	Statement:</div>\r\n<div style=\"font-weight:bold;\">\r\n	Should there be a cap on maximum number of contestants for parliamentary elections in any constituency?</div>\r\n<div style=\"font-weight:bold;\">\r\n	Arguments:</div>\r\n<div style=\"font-weight:bold;\">\r\n	I.Yes. This will make the parliamentary elections more meaningful as the voters can make a considered judgement for casting their vote.</div>\r\n<div style=\"font-weight:bold;\">\r\n	II. No. In a democracy any person fulfilling the eligibility criteria can contest parliamentary elections and there should be no restrictions.</div>', 1, 3, 10, 1, '2024-01-17 20:48:48', 0, NULL, NULL, '', '', NULL, NULL),
(104, '<div style=\"font-weight:bold;\">\r\n	Statement:</div>\r\n<div style=\"font-weight:bold;\">\r\n	Open book system should be introduced in the examinations</div>\r\n<div style=\"font-weight:bold;\">\r\n	Arguments:</div>\r\n<div style=\"font-weight:bold;\">\r\n	I. Yes, because it will avoid mass copying</div>\r\n<div style=\"font-weight:bold;\">\r\n	II. No, because then all students will get 100% marks</div>', 1, 4, 10, 1, '2024-01-17 20:48:48', 0, NULL, NULL, '', '', NULL, NULL),
(105, '<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Should Indian scientists working abroad be called back to India?</div>\n<div style=\"font-weight:bold;\">Arguments:</div>\n<div style=\"font-weight:bold;\">I. Yes. They must serve the motherland first and forget about discoveries, honours, facilities and all.</div>\n<div style=\"font-weight:bold;\">II. No. We have enough talent; let them stay where they want.</div>\n', 1, 5, 10, 1, '2024-01-17 20:48:48', 0, NULL, NULL, '', '', NULL, NULL),
(106, '<div style=\"font-weight:bold;\">\r\n	Statement:</div>\r\n<div style=\"font-weight:bold;\">\r\n	Should workers be allowed to participate in the management of factories in India?</div>\r\n<div style=\"font-weight:bold;\">\r\n	Arguments:</div>\r\n<div style=\"font-weight:bold;\">\r\n	I. Yes, It is the present management theory.</div>\r\n<div style=\"font-weight:bold;\">\r\n	II. No, many workers are illiterate. Hence their contribution will not be of value</div>', 1, 6, 10, 1, '2024-01-17 20:48:48', 0, NULL, NULL, '', '', NULL, NULL),
(107, '<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Should internal assessment in colleges be abolished?</div>\n<div style=\"font-weight:bold;\">Arguments:</div>\n<div style=\"font-weight:bold;\">I. Yes. This will help in reducing the possibility of favouritism.</div>\n<div style=\"font-weight:bold;\">II. No, teaching faculty will lose control over students.</div>\n', 1, 7, 10, 1, '2024-01-17 20:48:48', 0, NULL, NULL, '', '', NULL, NULL),
(108, '<div style=\"font-weight:bold;\">Statement: </div>\n<div style=\"font-weight:bold;\">Success is how much a person bounces up after hitting the bottom.</div>\n<div style=\"font-weight:bold;\">Assumptions:</div>\n<div style=\"font-weight:bold;\">I. Success requires conscious efforts without being discourage by failure.</div>\n<div style=\"font-weight:bold;\">II. Failure cannot be considered an acceptable thing.</div>\n', 1, 8, 10, 1, '2024-01-17 20:48:48', 0, NULL, NULL, '', '', NULL, NULL),
(109, '<div style=\"font-weight:bold;\">\r\n	There is a growing feeling amongst the larger Asian countries that the West is pass. The news coming out of there, especially since the 2008 financial crisis, is of declining populations, big layoffs and economic meltdowns in several countries of the European Union (EU), Italy being the latest. So much of bad news over an extended period gives the impression that, the rise of the West has finally halted; that the West is now in cowering retreat.</div>\r\n<div style=\"font-weight:bold;\">\r\n	Which of the following weakens the argument provided in the passage above?</div>\r\n<div style=\"font-weight:bold;\">\r\n	I. The Western media has contributed to perpetuating the news of the decline of the West.</div>\r\n<div style=\"font-weight:bold;\">\r\n	II. The rich West hangs together, with a combined GDP several times, than that of the rest of the world.</div>\r\n<div style=\"font-weight:bold;\">\r\n	III. The U.S. has a growing population and remains the most productive and innovative in the world, as well as militarily the most powerful.</div>', 1, 9, 10, 1, '2024-01-17 20:48:48', 0, NULL, NULL, '', '', NULL, NULL),
(110, '<div style=\"font-weight:bold;\">It is perhaps no surprise that, political parties are deeply divided over the idea of holding simultaneous elections for the Lok Sabha and the State Assemblies. During consultations initiated by the Law Commission of India, nine parties opposed it, arguing that, it went against the constitutional fabric and that it would be impractical. Four parties backed the concept.</div>\n<div style=\"font-weight:bold;\">Which of the following, strengthens the case for simultaneous elections?</div>\n<div style=\"font-weight:bold;\">I. A simultaneous poll, particularly in this era, where news is easily and widely disseminated, will privilege national issues over regional ones, even if, arguably, the reverse may happen too.</div>\n<div style=\"font-weight:bold;\">II. Assemblies can be bunched into two categories based on whether their terms end close to the 2019 or the 2024 Lok Sabha elections and then elections could be held for one group in 2019, and for another in 2024, so that, subsequent elections could be synchronised.</div>\n<div style=\"font-weight:bold;\">III. Election expenditure will be drastically cut and ruling dispensations will be able to focus on legislation and governance, rather than having to be in campaign mode forever.</div>\n', 1, 10, 10, 1, '2024-01-17 20:48:48', 0, NULL, NULL, '', '', NULL, NULL),
