(130, '<div style=\"font-weight:bold;\">What is the output of C Program? </div>\n<div style=\"font-weight:bold;\">int main()</div>\n<div style=\"font-weight:bold;\">{</div>\n<div style=\"font-weight:bold;\">int str[]={\'g\',\'l\',\'o\',\'b\',\'y\'};</div>\n<div style=\"font-weight:bold;\">printf(\"A%c \",str);</div>\n<div style=\"font-weight:bold;\">printf(\"A%s \",str);</div>\n<div style=\"font-weight:bold;\">printf(\"A%c \",str[0]);</div>\n<div style=\"font-weight:bold;\">return 0;</div>\n<div style=\"font-weight:bold;\">}</div>\n', 1, 10, 12, 1, '2024-01-17 20:48:48', 0, NULL, NULL, '', '', NULL, NULL);
